import React from "react";
import "../style.css";
function Header() {
  if (window.pageYOffset >= sticky) {
    navbar.classList.add("sticky")
  } else {
    navbar.classList.remove("sticky");
  }
  return (
    <div >
    <div className="navbar">
      <img src="./img/download.png" alt="logo" className="navbar-logo" />
      <div className="search-bar">
        <div className="search-bar-text">Anywhere</div>
        <div className="search-bar-text">Any Week</div>
        <div className="search-bar-text2">Add guests</div>
        <div className="search-icon-div">
          <div className="search-icon" />
          <img style={{ height: "28px" }} src="./img/magni.png" alt="" />
        </div>
      </div>
      <div style={{ gap: "20px",alignItems:"center" }} className="profile-container">
        <div style={{ display: "flex", gap: "8px", alignItems: "center" }}>
          <div className="search-bar-text">Airbnb Your Home</div>
          <div>
            <img
              style={{ height: "18px", cursor: "pointer",paddingTop:"6px" }}
              src="./img/wo.png"
              alt=""
            />
          </div>
        </div>
        <div className="btn">
          <button
            style={{
              paddingbottom: "8px",
              border: "none",
              display: "flex",
              borderRadius: "20px",
              cursor: "pointer",
            }}
          >
            <img style={{ height: "26px" }} src="./img/three.png" alt="" />
            <img style={{ height: "26px" }} src="./img/user.png" alt="" />
          </button>
        </div>
      </div>
      </div>
      <hr style={{marginRight:"-50px",marginLeft:"-50px"}}/>
    </div>
  );
}

export default Header;
